import { Container, Row, Col, Card} from "react-bootstrap";
import useAuth from "../auth/useAuth";

export default function AccountPage() {
    const { user } = useAuth();

    return (
        <Container>
            <Row className="mt-5"> 
                <Col xs={12} md={{ span: 6}} className='text-center'>
                    <img 
                        src='/img/images (1).jpg'
                        alt='profile'
                        style={{
                            width: '200px',
                            height: '200px',
                            borderRadius: '50%',
                            objectFit: 'cover'
                        }}
                    />
                </Col>
                <Col>
                    <Card>
                        <p>
                            <b>nombre:</b> {user.name}
                        </p>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
}
